                        "Desc": "Каждая гора, каждый камень и вся земля пронизаны энергией Гео, но только единицы могут ею управлять.<br><br><color style='color:#FFD780;'>Быстрое нажатие:</color><br>Приказывает силам земли создать Каменную стелу.<br><br><color style='color:#FFD780;'>Долгое нажатие:</color><br>Заставляет окружающую Гео энергию взорваться, что вызывает следующие эффекты:<br> ·  Создаёт Каменную стелу, если не было достигнуто их максимально допустимое количество.<br> ·  Создаёт Яшмовый щит. Поглощение урона щита зависит от макс. HP Чжун Ли.<br> ·  Наносит <color style='color:#FFE699;'>Гео урон по площади</color>.<br> ·  Если поблизости есть цели с <color style='color:#FFE699;'>элементом Гео</color>, вытягивает большое количество <color style='color:#FFE699;'>Гео элемента</color> из максимум 2 таких целей. Этот эффект не наносит урона.<br><br><color style='color:#FFD780;'>Каменная стела:</color><br>При создании наносит <color style='color:#FFE699;'>Гео урон по площади</color>.<br>Также Каменная стела входит в резонанс с окружающими её другими <color style='color:#FFE699;'>Гео конструкциями</color>, нанося <color style='color:#FFE699;'>Гео урон</color> окружающим врагам.<br>Каменная стела считается <color style='color:#FFE699;'>Гео конструкцией</color>, на неё можно взобраться или использовать её для блокирования атак.<br>Первоначально может существовать только одна Каменная стела, созданная самим Чжун Ли.<br><br><color style='color:#FFD780;'>Яшмовый щит:</color><br>Весь элементальный и физический урон поглощается на 150% эффективнее.<br>Персонажи, защищённые Яшмовым щитом, будут понижать элементальное и физическое сопротивление врагов в небольшом радиусе на 20%. Этот эффект не может складываться.<br><br><i>Настоящий мастер может вырезать нефрит и придать форму золоту одной лишь мыслью.</i>",
